import React, {useEffect, useState} from "react";


function App() {
    const [data, setData] = useState(null);

    useEffect(() => {
        fetch("http://localhost:5000/api")
            .then(res => res.json())
            .then(data => setData("welcome"))
    }, [])
  return (
    <div className="App">
      <h1>{!data ? 'loading' : data}</h1>
    </div>
  );
}

export default App;
